import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'Sistema de Veículos';
}
<div class="container">
  <header class="header">
    <h1>{{ title }}</h1>
  </header>
  
  <main class="main-content">
    <app-vehicle-list></app-vehicle-list>
  </main>
</div>
